 nieuwsbericht of actueel artikel','','8.0.2'),(7194,'Administrator','','8.0.2'),(7195,'Search result highlighting input','','8.0.2'),(7196,'HTML Datetime','','8.0.2'),(7197,'l, F j, Y - H:i','PHP date format','8.0.2'),(7198,'D, m/d/Y - H:i','PHP date format','8.0.2'),(7199,'m/d/Y - H:i','PHP date format','8.0.2'),(7200,'Links related to the active user account','','8.0.2'),(7201,'Administrative task links','','8.0.2'),(7202,'Site information links','','8.0.2'),(7203,'Site section links','','8.0.2'),(7204,'User tool links, often added by modules','','8.0.2'),(7205,'Block the selected user(s)','','8.0.2'),(7206,'[user:display-name],\n\nA request to cancel your account has been made at [site:name].\n\nYou may now cancel your account on [site:url-brief] by clicking this link or copying and pasting it into your browser:\n\n[user:cancel-url]\n\nNOTE: The cancellation of your account is not reversible.\n\nThis link expires in one day and nothing will happen if it is not used.\n\n--  [site:name] team','','8.0.2'),(7207,'Account cancellation request for [user:display-name] at [site:name]','','8.0.2'),(7208,'[user:display-name],\n\nA request to reset the password for your account has been made at [site:name].\n\nYou may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password. It expires after one day and nothing will happen if it\'s not used.\n\n--  [site:name] team','','8.0.2'),(7209,'Replacement login information for [user:display-name] at [site:name]','','8.0.2'),(7210,'[user:display-name],\n\nA site administrator at [site:name] has created an account for you. You may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:name]\npassword: Your password\n\n--  [site:name] team','','8.0.2'),(7211,'[user:display-name],\n\nThank you for registering at [site:name]. You may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:name]\npassword: Your password\n\n--  [site:name] team','','8.0.2'),(7212,'Account details for [user:display-name] at [site:name]','','8.0.2'),(7213,'[user:display-name],\n\nThank you for registering at [site:name]. Your application for an account is currently pending approval. Once it has been approved, you will receive another email containing information about how to log in, set your password, and other details.\n\n\n--  [site:name] team','','8.0.2'),(7214,'Account details for [user:display-name] at [site:name] (pending admin approval)','','8.0.2'),(7215,'[user:display-name],\n\nYour account at [site:name] has been activated.\n\nYou may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:account-name]\npassword: Your password\n\n--  [site:name] team','','8.0.2'),(7216,'Account details for [user:display-name] at [site:name] (approved)','','8.0.2'),(7217,'[user:display-name],\n\nYour account on [site:account-name] has been blocked.\n\n--  [site:name] team','','8.0.2'),(7218,'Account details for [user:display-name] at [site:name] (blocked)','','8.0.2'),(7219,'[user:display-name],\n\nYour account on [site:name] has been canceled.\n\n--  [site:name] team','','8.0.2'),(7220,'Account details for [user:display-name] at [site:name] (canceled)','','8.0.2'),(7221,'Find and manage custom blocks.','','8.0.2'),(7222,', ','','8.0.2'),(7223,'Fid','','8.0.2'),(7224,'1@count','','8.0.2'),(7225,'<p>This page provides the ability to add common languages to your site.</p><p>If the desired language is not available, you can add a custom language.</p>','','8.0.2'),(7226,'<p>Choose a language from the list, or choose \"Custom language...\" at the end of the list.</p><p>Click the \"Add language\" button when you are done choosing your language.</p><p>When adding a custom language, you will get an additional form where you can provide the name, code, and direction of the language.</p>','','8.0.2'),(7227,'Continuing on','','8.0.2'),(7228,'<p>Now that you have an overview of the \"Add languages\" feature, you can continue by:<ul><li>Adding a language</li><li>Adding a custom language</li><li><a href=\"[site:url]/admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.0.2'),(7229,'<p>You cannot change the code of a language on the site, since it is used by the system to keep track of the language.</p>','','8.0.2'),(7230,'<p>The language name is used throughout the site for all users and is written in English. Names of built-in languages can be translated using the Interface Translation module, and names of both built-in and custom languages can be translated using the Configuration Translation module.</p>','','8.0.2'),(7231,'<p>Choose if the language is a \"Left to right\" or \"Right to left\" language.</p><p>Note that not all themes support \"Right to left\" layouts, so test your theme if you are using \"Right to left\".</p>','','8.0.2'),(7232,'<p>Now that you have an overview of the \"Edit language\" feature, you can continue by:<ul><li>Editing a language</li><li><a href=\"[site:url]/admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.0.2'),(7233,'<p>The \"Languages\" page allows you to add, edit, delete, and reorder languages for the site.</p>','','8.0.2'),(7234,'<p>To add more languages to your site, click the \"Add language\" button.</p><p>Added languages will be displayed in the language list and can then be edited or deleted.</p>','','8.0.2'),(7235,'<p>To reorder the languages on your site, use the drag icons next to each language.</p><p>The order shown here is the display order for language lists on the site such as in the language switcher blocks provided by the Interface Translation and Content Translation modules.</p><p>When you are done with reordering the languages, click the \"Save configuration\" button for the changes to take effect.</p>','','8.0.2'),(7236,'<p>You can change the default language of the site by choosing one of your configured languages as default. The site will use the default language in situations where no choice is made but a language should be set, for example as the language of the displayed interface.</p>','','8.0.2'),(7237,'<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>','','8.0.2'),(7238,'<p>Now that you have an overview of the \"Languages\" page, you can continue by:<ul><li><a href=\"[site:url]/admin/config/regional/language/add\">Adding a language</a></li><li>Reordering languages</li><li>Editing a language</li><li>Deleting a language</li></ul></p>','','8.0.2'),(7239,'This page allows you to translate the user interface or modify existing translations. If you have installed your site initially in English, you must first add another language on the <a href=\"[site:url]/admin/config/regional/language\">Languages page</a>, in order to use this page.','','8.0.2'),(7240,'Choose the language you want to translate.','','8.0.2'),(7241,'Enter the specific word or sentence you want to translate, you can also write just a part of a word.','','8.0.2'),(7242,'Filter the search','','8.0.2'),(7243,'You can search for untranslated strings if you want to translate something that isn\'t translated yet. If you want to modify an existing translation, you might want to search only for translated strings.','','8.0.2'),(7244,'You can write your own translation in the text fields of the right column. Try to figure out in which context the text will be used in order to translate it in the appropriate way.','','8.0.2'),(7245,'When you have finished your translations, click on the <em>Save translations</em> button. You must save your translations, each time before changing the page or making a new search.','','8.0.2'),(7246,'The translations you have made here will be used on your site\'s user interface. If you want to use them on another site or modify them on an external translation editor, you can <a href=\"[site:url]/admin/config/regional/translate/export\">export them</a> to a .po file and <a href=\"[site:url]/admin/config/regional/translate/import\">import them</a> later.','','8.0.2'),(7247,'{{ arguments.created_year_month }}','','8.0.2'),(7248,'All content promoted to the front page.','','8.0.2'),(7249,'Last update','','8.0.2'),(7250,'Content belonging to a certain taxonomy term.','','8.0.2'),(7251,'{{ arguments.tid }}','','8.0.2'),(7252,'Shows a list of the newest user accounts on the site.','','8.0.2'),(7253,'Shows the user names of the most recently active users, and the total number of active users.','','8.0.2'),(7254,'View edit page','','8.0.2'),(7255,'Manage view settings','','8.0.2'),(7256,'View or edit the configuration.','','8.0.2'),(7257,'Displays in this view','','8.0.2'),(7258,'A display is a way of outputting the results, e.g., as a page or a block. A view can contain multiple displays, which are listed here